import React from "react";

function Login(){
    function submitData(e){
        e.preventDefault();
    }
    function validateData(){
        console.log("ok");
    }
    return(
        <div>
            <h1>Login</h1>
            <form onSubmit={submitData}>
                <input type="text" placeholder="Enter username" onChange={validateData}/>
                <br /><br />
                <input type="text" placeholder="Enter Pass" onChange={validateData}/>
                <br /><br />
                <button>Submit</button>
            </form>
        </div>
    )
}
export default Login;
